import React from 'react';
import './Styles/Tailwind.css';
import Button from './ComponentsComponents\Button.tsx'

function App() {
  return (
    <>
      <h1> Next Button Component</h1>
      <Button 
        border="none"
        color="pink"
        height = "200px"
        onClick={() => console.log("You clicked on the pink circle!")}
        radius = "50%"
        width = "200px"
        children = "I'm a pink circle!"
      />

    </>
  );
}

export default App;
